script: |
  super -f text -I q1535.spq | sort > q1535.out

inputs:
  - name: q1535.spq
    data: |
      SELECT + COUNT ( * ) FROM tab1 (FORMAT parquet) cor0 WHERE NOT col1 BETWEEN - col0 * - col2 + ( - col1 ) + + col0 + - - col0 AND NULL;
  - name: tab1

outputs:
  - name: q1535.out
    data: |
      3
